import { useState } from 'react';
import './App.css';
import SubmitForm from './components/SubmitForm';

function App() {
  const [formData, setFormData] = useState([]);
  return (
    <div className="App">
      <SubmitForm formData={formData} setFormData={setFormData}/>

      <table>
        <tr>
          <td>이름</td>
          <td>가격</td>
        </tr>
        {formData.map(item => (
          <li key={item.id}>{item.name}</li>
        ))}
      </table>
    </div>
  );
}

export default App;
